milestones.description:
Умови розрахунку: 
перший платіж: за фактично виконані роботи з розробки проєктної документації протягом 7 (семи) робочих днів з дати підписання уповноваженими особами Сторін акту здавання-приймання виконаних робіт з розробки проєктної документації;
другий платіж: перерахування авансу протягом 10 робочих днів з дня відправлення Замовником листа-повідомлення про початок виконання будівельних робіт, у розмірі 30 % від вартості зазначеній у п. 3.1.3. Договору;
Погашення авансу здійснюється під час оплати за фактично виконані будівельні роботи та змонтоване устаткування (обладнання) шляхом вирахування із суми вартості виконаних робіт та змонтованого устаткування (обладнання), відповідно до Акту, Звіту та Підсумкового звіту, акту про здавання-приймання устаткування, обладнання (змонтованого), суми авансу до повного погашення авансу. 
Наступні платежі за фактично виконані будівельні роботи та змонтоване устаткування (обладнання): Замовник здійснює оплату 95% вартості фактично виконаних будівельних робіт та змонтованого устаткування (обладнання) протягом 7 (семи) робочих днів з дати підписання уповноваженими особами Сторін Акту, Звіту та Підсумкового звіту. 
Оплата 5% вартості фактично виконаних будівельних робіт та змонтованого устаткування (обладнання), що підтверджені підписаними раніше Актами, Звітами та Підсумковими звітами, здійснюється протягом 10 (десяти) робочих днів з дати отримання Замовником сертифікату про відповідність закінченого будівництвом об’єкта проектній документації.
